import { StrictMode } from 'react';
import { render } from 'react-dom';
import App from './App';

app.use(express.static(__dirname));

app.get("/*", function(req, res) {
  res.sendFile(path.join(__dirname, "index.html"));
});

render(
  <StrictMode>
    <App />
  </StrictMode>,
  document.getElementById('root')
);
